import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

function Header(){
    return(
        <nav class="navbar bg-body-tertiary">
            <div class="container-fluid">
                <h4>Cisco Meraki</h4>
            </div>
        </nav>
    )
}
export default Header;
